import React from 'react';
import './Table.css';
import In_form from './Rake_in_form';

const OpenFormButton = ({ In_form }) => {
  const handleClick = () => {
    In_form(); // Call the callback function to open the form page
  };

  return (
    <button onClick={handleClick} className='Form_Button'>
        <ion-icon name="reader" />
    </button>
  );
};

export default OpenFormButton;
